INSERT INTO `evaluation_questions` (`question_id`, `category`, `question_text`, `status`) VALUES
(''1'', ''Soft Skills'', ''Describe a time you worked effectively in a team.'', ''1''),
(''2'', ''Soft Skills'', ''How do you handle stressful situations at work or school?'', ''1''),
(''3'', ''Soft Skills'', ''Give an example of how you adapted to a major change.'', ''1''),
(''4'', ''Soft Skills'', ''How do you approach solving a difficult problem?'', ''1''),
(''5'', ''Soft Skills'', ''What motivates you to achieve your goals?'', ''1''),
(''6'', ''Soft Skills'', ''How do you manage your time when working on multiple tasks?'', ''1''),
(''7'', ''Soft Skills'', ''Describe a situation where you showed leadership.'', ''1''),
(''8'', ''Soft Skills'', ''How do you respond to constructive criticism?'', ''1''),
(''9'', ''Soft Skills'', ''What steps do you take to stay organized?'', ''1''),
(''10'', ''Soft Skills'', ''How do you maintain a positive attitude during setbacks?'', ''1''),
(''11'', ''Communication Skills'', ''Explain a technical concept to someone with no background in the subject.'', ''1''),
(''12'', ''Communication Skills'', ''How do you ensure your message is clearly understood?'', ''1''),
(''13'', ''Communication Skills'', ''Describe a time you resolved a misunderstanding.'', ''1''),
(''14'', ''Communication Skills'', ''How do you actively listen during conversations?'', ''1''),
(''15'', ''Communication Skills'', ''What strategies do you use to communicate in a group setting?'', ''1''),
(''16'', ''Communication Skills'', ''How do you handle feedback from others?'', ''1''),
(''17'', ''Communication Skills'', ''Describe a situation where you had to persuade someone.'', ''1''),
(''18'', ''Communication Skills'', ''How do you adjust your communication style for different audiences?'', ''1''),
(''19'', ''Communication Skills'', ''What role does non-verbal communication play in your interactions?'', ''1''),
(''20'', ''Communication Skills'', ''How do you clarify instructions or expectations when they are unclear?'', ''1''),
(''21'', ''Personal and Interpersonal Skills'', ''Demonstrated the ability to integrate theories learned in school and the practical work in your company.'', ''1''),
(''22'', ''Personal and Interpersonal Skills'', ''Demonstrated evidence of growth as a result of his apprenticeship.'', ''1''),
(''23'', ''Personal and Interpersonal Skills'', ''Demonstrated assertiveness and cleverness to new endeavors in the course of his/her training.'', ''1''),
(''24'', ''Personal and Interpersonal Skills'', ''Demonstrated adequate knowledge of work done.'', ''1''),
(''25'', ''Personal and Interpersonal Skills'', ''Demonstrated promptness and active attendance.'', ''1''),
