(''121'', ''59829536'', ''1'', ''I collaborated with classmates on a group project by dividing tasks based on strengths and keeping communication clear.'', ''2025-11-20 12:23:53''),
(''122'', ''59829536'', ''2'', ''I stay calm by breaking tasks into smaller steps and focusing on what I can control.'', ''2025-11-20 12:23:53''),
(''123'', ''59829536'', ''3'', ''When my schedule shifted unexpectedly, I reorganized my priorities and adjusted my routine to stay on track.'', ''2025-11-20 12:23:53''),
(''124'', ''59829536'', ''4'', ''I analyze the situation, gather information, consider possible solutions, and choose the most practical one.'', ''2025-11-20 12:23:53''),
(''125'', ''59829536'', ''5'', ''I’m motivated by personal growth and the satisfaction of reaching milestones I set for myself.'', ''2025-11-20 12:23:53''),
(''126'', ''59829536'', ''6'', ''I use a priority list and allocate specific time blocks for each task.'', ''2025-11-20 12:23:53''),
(''127'', ''59829536'', ''7'', ''I took initiative during a group assignment by organizing meetings and helping keep everyone focused.'', ''2025-11-20 12:23:53''),
(''128'', ''59829536'', ''8'', ''I listen carefully, reflect on the feedback, and apply it to improve.'', ''2025-11-20 12:23:53''),
(''129'', ''59829536'', ''9'', ''I keep a planner, set reminders, and maintain clear folders for my work.'', ''2025-11-20 12:23:53''),
(''130'', ''59829536'', ''10'', ''I remind myself that challenges are learning opportunities and focus on what I can improve going forward.'', ''2025-11-20 12:23:53''),
(''131'', ''59829536'', ''11'', ''Wi-Fi is like an invisible bridge that lets your devices talk to the internet without using any wires; your router acts like a tiny radio station that sends information through the air so your phone, laptop, or tablet can receive it and send messages back.'', ''2025-11-20 12:23:53''),
(''132'', ''59829536'', ''12'', ''I speak concisely, check for understanding, and encourage questions.'', ''2025-11-20 12:23:53''),
(''133'', ''59829536'', ''13'', ''I cleared up a group project issue by calmly explaining my perspective and listening to the other person’s concerns.'', ''2025-11-20 12:23:53''),
(''134'', ''59829536'', ''14'', ''I maintain eye contact, avoid interrupting, and summarize key points to show understanding.'', ''2025-11-20 12:23:53''),
(''135'', ''59829536'', ''15'', ''I share ideas clearly, stay on topic, and make sure everyone has a chance to speak.'', ''2025-11-20 12:23:53''),
(''136'', ''59829536'', ''16'', ''I stay open-minded, ask clarifying questions, and use the feedback to improve.'', ''2025-11-20 12:23:53''),
(''137'', ''59829536'', ''17'', ''I convinced a teammate to try a different approach by explaining its benefits and providing examples.'', ''2025-11-20 12:23:53''),
(''138'', ''59829536'', ''18'', ''I consider their background, expectations, and preferred level of detail before speaking.'', ''2025-11-20 12:23:53''),
(''139'', ''59829536'', ''19'', ''I use positive body language, such as nodding and open posture, to show engagement.'', ''2025-11-20 12:23:53''),
(''140'', ''59829536'', ''20'', ''I ask specific follow-up questions and restate what I understand to confirm accuracy.'', ''2025-11-20 12:23:53''),
(''141'', ''59829536'', ''28'', ''I reproduce the issue, check logs and error messages, isolate the failing component, add targeted diagnostics, and test fixes step by step.'', ''2025-11-20 12:23:53''),
(''142'', ''59829536'', ''29'', ''I use meaningful names, consistent formatting, modular functions, clear comments, and follow established style guidelines.'', ''2025-11-20 12:23:53''),
(''143'', ''59829536'', ''30'', ''\nI create feature branches, commit frequently with clear messages, open pull requests for review, and resolve conflicts before merging.'', ''2025-11-20 12:23:54''),
(''144'', ''59829536'', ''31'', ''I rely on unit, integration, and end-to-end tests, and I write test cases that cover normal behavior, edge cases, and failure scenarios.'', ''2025-11-20 12:23:54''),
(''145'', ''59829536'', ''32'', ''I profile performance, examine query plans, reduce unnecessary operations, add indexes if needed, and retest the improvement.'', ''2025-11-20 12:23:54''),
(''146'', ''59829536'', ''33'', ''I identify the main goal, divide it into logical subproblems, define clear inputs and outputs, and tackle each component independently.'', ''2025-11-20 12:23:54''),
(''147'', ''59829536'', ''34'', ''I validate inputs, sanitize outputs, protect authentication and sessions, encrypt sensitive data, and guard against common attacks like SQL injection and XSS.'', ''2025-11-20 12:23:54''),
(''148'', ''59829536'', ''35'', ''I follow reputable blogs, read documentation, take courses, and experiment with new tools in personal projects.'', ''2025-11-20 12:23:54''),
(''149'', ''59829536'', ''36'', ''I check for correctness, readability, adherence to standards, test coverage, and potential security or performance issues.'', ''2025-11-20 12:23:54''),
(''150'', ''59829536'', ''37'', ''I would use load balancing, horizontal scaling, efficient caching, stateless services, and a database strategy that supports high throughput.\n\n'', ''2025-11-20 12:23:54''),
(''151'', ''59829532'', ''1'', ''On my freshman year it was when we were making a project using C++. The project was all about E-Marketplace like the steam marketplace.'', ''2025-11-20 15:45:14''),
(''152'', ''59829532'', ''2'', ''I would handle it by first being calm and think other stuff to at least try and avoid the situation from it being out of hand before acting.'', ''2025-11-20 15:45:14''),
(''153'', ''59829532'', ''3'', ''By first acknowledging my feelings. staying open-minded and then breaking it down slowly since it can challenging at most times but it will help in the long process.'', ''2025-11-20 15:45:14''),
(''154'', ''59829532'', ''4'', ''I would think of a way on how to handle the problem carefully before resolving it.'', ''2025-11-20 15:45:14''),
(''155'', ''59829532'', ''5'', ''Family.'', ''2025-11-20 15:45:14''),
(''156'', ''59829532'', ''6'', ''By first focusing on the important tasks before moving to another.'', ''2025-11-20 15:45:14''),
(''157'', ''59829532'', ''7'', ''It was when there a time when we\'re almost past deadline from our final project where I showed leadership I stepped in to calmly assess the situation, clarifying priorities, organizing tasks based on strengths, and communicating transparently while motivating others to stay focused. By guiding the group toward a clear plan and supporting them through the stres.'', ''2025-11-20 15:45:14''),
(''158'', ''59829532'', ''8'', ''Focus on understanding the other person’s perspective, ask clarifying questions if needed, and acknowledge the value in what they’re saying. Thank them for the feedback, reflect on how it can help you improve, and explain any steps you plan to take to address the issue.'', ''2025-11-20 15:45:14''),
(''159'', ''59829532'', ''9'', ''Break large tasks into smaller steps, and use calendars or reminders to keep deadlines visible. Keep your physical and digital spaces tidy by regularly decluttering and putting things back where they belong. Establish routines, like checking emails at specific times or planning your week every Sunday, to reduce chaos and decision fatigue.'', ''2025-11-20 15:45:14''),
(''160'', ''59829532'', ''10'', ''First would be acknowledging your emotions, frustrations and disappointment and then focusing on what I can control, and try to reframe the situation as an opportunity to learn or improve rather than a failure.'', ''2025-11-20 15:45:14''),
(''161'', ''59829532'', ''11'', ''Wi-Fi works like sending a message by whispering across a room. Your device sends invisible radio signals to a router, the router understands them and sends the information to the internet, then sends the response back the same way. It’s simply wireless communication that happens so fast it feels instant.'', ''2025-11-20 15:45:14''),
(''162'', ''59829532'', ''12'', ''You ensure your message is clearly understood by keeping it simple, specific, and organized—use plain language, avoid unnecessary jargon, and focus on one idea at a time. Check for understanding by asking questions or inviting the other person to repeat the key points in their own words.'', ''2025-11-20 15:45:14''),
(''163'', ''59829532'', ''13'', ''During a group project, two team members disagreed about how to approach a task, and tension was starting to affect the whole team. I stepped in by calmly listening to both sides without taking sides, then restated each person’s points to ensure everyone felt heard. After clarifying the misunderstanding, I suggested a compromise that combined the best parts of both ideas.'', ''2025-11-20 15:45:14''),
(''164'', ''59829532'', ''14'', ''Maintaining eye contact, nod, and use small verbal cues like “I see” to show engagement. Reflecting back what I\'ve heard by paraphrasing or summarizing their points, and ask clarifying questions if something isn’t clear. Avoiding distractions, staying patient, and paying attention not just to words but also to tone and body language, to fully understand the speaker’s message and intent.'', ''2025-11-20 15:45:14''),
(''165'', ''59829532'', ''15'', ''First I would actively listen to others opinion to understand their perspective. Speaking clearly and concisely and focusing on the main point to avoid confusion.'', ''2025-11-20 15:45:14''),
(''166'', ''59829532'', ''16'', ''Listening openly without interrupting or getting defensive, even if the feedback is critical. Focus on understanding the points being made, and ask clarifying questions if something is unclear. Taking action where appropriate, using the feedback to adjust your approach or performance, and follow up if needed to show that you value the input.'', ''2025-11-20 15:45:14''),
(''167'', ''59829532'', ''17'', ''I presented clear data, examples from past campaigns, and potential outcomes to support my idea. I listened to the concerns of others and addressed them respectfully, showing that I understood their perspective.'', ''2025-11-20 15:45:15''),
(''168'', ''59829532'', ''18'', ''I first consider their knowledge level and interests. For example, with a technical team, I might use more specialized language and focus on details, while with a non-expert group, I’d keep things simpler and use analogies. I also pay attention to the tone: if I’m speaking with colleagues, I might use a more casual, collaborative tone, but for clients or senior executives, I’d be more formal and concise.'', ''2025-11-20 15:45:15''),
(''169'', ''59829532'', ''19'', ''Non-verbal communication is key because it reinforces what you’re saying. Body language, eye contact, facial expressions, and tone of voice all convey emotions and intentions, often more than words alone. Being aware of these cues helps ensure your message is clear and strengthens connections with others.'', ''2025-11-20 15:45:15''),
(''170'', ''59829532'', ''20'', ''If instructions are unclear, I ask specific questions to get more details and confirm my understanding by summarizing what I think is being asked. This ensures I\'m on the same page and avoids confusion.'', ''2025-11-20 15:45:15''),
(''171'', ''59829532'', ''28'', ''To debug intermittent issues, I first try to reproduce the problem and analyze logs or error messages for clues. I isolate the code causing the issue, review recent changes, and check for common problems like memory leaks or race conditions. Using debugging tools, I step through the code to inspect variables and execution flow. I test edge cases, then implement a fix, ensuring to test thoroughly. Finally, I add tests to prevent similar issues in the future.'', ''2025-11-20 15:45:15''),
(''172'', ''59829532'', ''29'', ''To ensure my code is readable and maintainable, I focus on clear, descriptive naming, consistent formatting, and modularization, breaking code into small, reusable functions. I use comments and documentation to explain complex logic and avoid over-commenting obvious code. I also avoid hardcoding values, opting for configuration files or constants, and prioritize proper error handling. Regular refactoring helps improve structure and readability, while version control with Git tracks changes and facilitates collaboration. Additionally, I write unit tests to ensure reliability and participate in code reviews for continuous improvement. This approach makes the code easier to understand, update, and maintain over time.'', ''2025-11-20 15:45:15''),
(''173'', ''59829532'', ''30'', ''When collaborating with Git, I start by cloning the repo and creating a separate feature branch for my work. I regularly pull updates from the main branch to stay in sync. I commit small, focused changes with clear messages, then push them to the remote. Once my feature is ready, I open a pull request, request a review, and make any necessary changes based on feedback. After approval, I merge my branch into the main branch and test everything to ensure it works. This workflow helps keep collaboration smooth, minimizes conflicts, and maintains code quality.'', ''2025-11-20 15:45:15''),
(''174'', ''59829532'', ''31'', ''To ensure software quality, I focus on essential testing types like unit testing (for individual components), integration testing (to ensure system parts work together), end-to-end testing (to simulate user behavior), regression testing (to check for breaking changes), performance testing (to identify bottlenecks), and user acceptance testing (to verify user requirements). When writing test cases, I first review the requirements to understand the expected behavior, then write clear, specific tests for both positive and negative scenarios. I automate tests wherever possible to ensure continuous validation, and I ensure each test case is descriptive so its purpose is easily understood. This comprehensive approach helps maintain reliable, performant, and user-friendly software.'', ''2025-11-20 15:45:15''),
(''175'', ''59829532'', ''32'', ''To optimize a slow database query or feature, I first identify bottlenecks using profiling tools, then ensure proper indexing and simplify the query. I consider caching for frequently accessed data and review the database design for improvements. In the application, I optimize code to reduce redundant queries. Finally, I benchmark performance and monitor metrics to ensure the changes improve speed.'', ''2025-11-20 15:45:15''),
(''176'', ''59829532'', ''33'', ''To break down a complex programming problem is to understand the requirements: Clarify what the problem is asking and what the end goal is. Divide into smaller tasks: Break the problem into manageable modules or components. Define inputs and outputs: Specify what data each part needs and what it should return. Visualize the flow: Use pseudocode or diagrams to map out how components interact. Implement and test independently: Build and test each module one by one before integration. Integrate and test: Combine the components and ensure they work together as expected.'', ''2025-11-20 15:45:15''),
(''177'', ''59829532'', ''34'', ''When developing web applications, I focus on secure input validation, strong authentication and authorization, data encryption (in transit and at rest), and proper session management. I ensure safe error handling, use security headers, and implement protections against XSS and CSRF. Regularly updating dependencies, applying rate limiting, and conducting security testing also help minimize vulnerabilities and ensure the app remains secure.'', ''2025-11-20 15:45:15''),
(''178'', ''59829532'', ''35'', ''I stay updated by following tech blogs, podcasts, and newsletters, engaging with online communities like GitHub and Reddit, and attending webinars or conferences. I also take online courses, explore new tools, and collaborate with peers through code reviews to keep learning and improving.'', ''2025-11-20 15:45:15''),
(''179'', ''59829532'', ''36'', ''When reviewing code, I focus on correctness, readability, and efficiency. I check for clear variable names, adherence to coding standards, and proper error handling. I also ensure sufficient tests are in place, the code is secure, and it’s scalable and maintainable. I provide constructive feedback and suggest improvements where needed.'', ''2025-11-20 15:45:15''),
(''180'', ''59829532'', ''37'', ''To handle increasing user load and ensure scalability, I’d use horizontal scaling with load balancing, break the system into microservices for independent scaling, and optimize databases with sharding and read replicas. I’d implement caching (e.g., Redis), use asynchronous processing for heavy tasks, and set up auto-scaling for resources. A CDN would handle static content, and I’d continuously monitor performance and conduct load testing to identify bottlenecks early. This ensures the system can scale efficiently as traffic grows.'', ''2025-11-20 15:45:15''),
(''181'', ''11223'', ''1'', ''I collaborated with my group by dividing tasks based on strengths, communicating clearly, and helping each other meet deadlines.'', ''2025-11-21 05:07:52''),
(''182'', ''11223'', ''2'', ''I stay calm, prioritize tasks, and break work into smaller steps to stay focused.'', ''2025-11-21 05:07:52''),
(''183'', ''11223'', ''3'', ''When a project’s requirements changed suddenly, I adjusted my plan, learned what was needed, and delivered on time.'', ''2025-11-21 05:07:52''),
(''184'', ''11223'', ''4'', ''I analyze the issue, break it down, explore possible solutions, and test the best option.'', ''2025-11-21 05:07:52''),
(''185'', ''11223'', ''5'', ''Personal growth, learning new skills, and the satisfaction of completing challenging tasks motivate me.'', ''2025-11-21 05:07:52''),
(''186'', ''11223'', ''6'', ''I set priorities, create a schedule, and focus on one task at a time.'', ''2025-11-21 05:07:52''),
(''187'', ''11223'', ''7'', ''I took the lead in organizing my team, assigning roles, and guiding everyone until the project was completed.'', ''2025-11-21 05:07:52''),
(''188'', ''11223'', ''8'', ''I listen, thank the person, and use the feedback to improve my work.'', ''2025-11-21 05:07:52''),
(''189'', ''11223'', ''9'', ''I use checklists, set reminders, and keep my workspace tidy'', ''2025-11-21 05:07:52''),
(''190'', ''11223'', ''10'', ''I focus on solutions, remind myself that setbacks are part of learning, and keep moving forward.'', ''2025-11-21 05:07:52''),
(''191'', ''11223'', ''11'', ''I break it into basic terms, use simple examples, and avoid jargon.'', ''2025-11-21 05:07:52''),
(''192'', ''11223'', ''12'', ''I speak clearly, keep it simple, and ask if they have questions.'', ''2025-11-21 05:07:52''),
(''193'', ''11223'', ''13'', ''I listened to both sides, explained my point calmly, and clarified the confusion.'', ''2025-11-21 05:07:52''),
(''194'', ''11223'', ''14'', ''I focus on the speaker, avoid interrupting, and repeat key points to show understanding.'', ''2025-11-21 05:07:52''),
(''195'', ''11223'', ''15'', ''I stay concise, listen to others, and make sure everyone has a chance to speak.'', ''2025-11-21 05:07:52''),
(''196'', ''11223'', ''16'', ''I stay open, thank them, and use the feedback to improve.'', ''2025-11-21 05:07:52''),
(''197'', ''11223'', ''17'', ''I explained the benefits clearly, addressed concerns, and showed evidence to support my idea.'', ''2025-11-21 05:07:53''),
(''198'', ''11223'', ''18'', ''I change my tone, detail level, and examples depending on who I’m talking to'', ''2025-11-21 05:07:53''),
(''199'', ''11223'', ''19'', ''I use eye contact, gestures, and facial expressions to show interest and respect.'', ''2025-11-21 05:07:53''),
(''200'', ''11223'', ''20'', ''I ask specific questions and restate the instructions to confirm I understand them correctly.'', ''2025-11-21 05:07:53''),
(''201'', ''11223'', ''28'', ''I reproduce the issue, check logs, isolate the problematic section, add debug statements, test each part, and fix the root cause.'', ''2025-11-21 05:07:53''),
(''202'', ''11223'', ''29'', ''I use clear names, consistent formatting, small functions, comments when needed, and follow coding standards.'', ''2025-11-21 05:07:53''),
(''203'', ''11223'', ''30'', ''I create branches, make clear commits, pull updates often, resolve conflicts, and submit pull requests for review.'', ''2025-11-21 05:07:53''),
(''204'', ''11223'', ''31'', ''I use unit tests, integration tests, and manual testing. I write test cases based on edge cases and expected behavior.'', ''2025-11-21 05:07:53''),
(''205'', ''11223'', ''32'', ''I analyze the query, check indexes, remove unnecessary operations, and test improvements step by step.'', ''2025-11-21 05:07:53''),
(''206'', ''11223'', ''33'', ''I define the goal, split it into small tasks, solve each part independently, then combine and test them.'', ''2025-11-21 05:07:53''),
(''207'', ''11223'', ''34'', ''I validate inputs, hash passwords, protect against SQL injection, use HTTPS, and manage user roles securely.'', ''2025-11-21 05:07:53''),
(''208'', ''11223'', ''35'', ''I read documentation, follow tech blogs, watch tutorials, and practice through small projects.'', ''2025-11-21 05:07:53''),
(''209'', ''11223'', ''36'', ''I check readability, logic, security, performance, and consistency with project standards.'', ''2025-11-21 05:07:53''),
(''210'', ''11223'', ''37'', ''I use load balancing, caching, efficient databases, and build the system so it can scale horizontally as users grow.'', ''2025-11-21 05:07:53'');
